import React, {useState} from "react";

import './User.css';


const User = () => {
    const [isChecked, setIsChecked] = useState('active');

    return (
        <div>
            <h3>User</h3>
            <label>
                <input type="radio"
                       name='activeBirth'
                       value='active'
                       checked={isChecked === 'active'}
                       onChange={(e) => {
                           setIsChecked(e.target.value)
                       }}
                />
            </label>
            <label>
                <input type="radio"
                       name='activeBirth'
                       value='notActive'
                       checked={isChecked === 'notActive'}
                       onChange={(e) => {
                           setIsChecked(e.target.value)
                       }}
                />
            </label>

        </div>
    )
}

export default User;
